const styles = theme => ({
    table: {
        width: 560
    },
    itemContainer: {
        backgroundColor: theme.palette.primary.main,
        borderRadius: 25,
        padding: 10,
        marginBottom: 10,
    },
    item: {
        fontSize: 16,
        fontWeight: 300,
        color: theme.palette.text.main
    }
  });
  export default styles;
